let searchInput = document.querySelector("#searchBooksByName"),
    searchVideosContent,
    containerBooks = $(".section-page .container-books");

currentPage = "materials";

(function () {
    if (localStorage.getItem("favoriteBooks") != null) {
        favoriteBooks = JSON.parse(localStorage.getItem("favoriteBooks"));
    } else {
        localStorage.setItem("favoriteBooks", JSON.stringify(favoriteBooks));
    }

    if (localStorage.getItem("idBooks") != null) {
        favoriteBooksNumber = JSON.parse(localStorage.getItem("idBooks"));
    } else {
        localStorage.setItem("idBooks", JSON.stringify(favoriteBooksNumber));
    }

})();


searchInput.addEventListener("keyup", () => {
    let inputValue = searchInput.value.toLowerCase();

    let filteredVideos = searchVideosContent.filter(function (objData) {
        let findData =
            objData.doctorName?.toLowerCase().includes(inputValue) ||
            objData.author?.toLowerCase().includes(inputValue) ||
            objData.bookName?.toLowerCase().includes(inputValue);

        return findData;
    });

    containerBooks.html("");

    arrayOfSomeItems = filteredVideos;

    if (numberClicked != 1 && numberBtn != 1) {
        repairPage("first");
    } else {
        repairPage("current");
    }

    repairPagination(arrayOfSomeItems);
});

